import React from "react";

const Pagination = (props) => {
  const { onLeftClick, onRightClick, pagina, totalPages } = props;

  return (
    <div className="pagination">
        <div className="icon">
          <button className="boton-Pagi" onClick={onRightClick}>Adelante</button>
        </div>
      <div>
        {pagina} de {totalPages}
      </div>
        <div className="icon">
        <button className="boton-Pagi" onClick={onLeftClick}>Atras</button>
        </div>
    </div>
  );
};

export default Pagination;
